use std::collections::HashMap;
use log::*;
//use serde_json::Value;

#[derive(Debug)]
pub struct ValueStatisticDetails {
    pub unit: String,
    pub unit_suffix: String,
    pub stat_type: String,
}

impl ValueStatisticDetails {
    fn new(unit: &str, stat_type: &str) -> Self {
        Self {
            unit: unit.to_string(),
            unit_suffix: suffix_lookup_value(unit),
            stat_type: stat_type.to_string(),
        }
    }
}

fn suffix_lookup_value(unit: &str) -> String {
    let suffix = HashMap::from([
        ("blocks", "blocks"),
        ("bytes", "bytes"),
        ("calls", "calls"),
        ("connections", "conn"),
        ("context switches", "csws"),
        ("corruptions", "corrupt"),
        ("current consensus term", "terms"),
        ("deletes", "dels"),
        ("entries", "entries"),
        ("failures", "fails"),
        ("files", "files"),
        ("hits", "hits"),
        ("indicator", "y/n"),
        ("iterators", "iters"),
        ("keys", "keys"),
        ("messages", "msgs"),
        ("microseconds", "us"),
        ("milliseconds", "ms"),
        ("nanoseconds", "ns"),
        ("nr", "nr"),
        ("operations", "ops"),
        ("parsers", "parsers"),
        ("processors", "procs"),
        ("properties", "props"),
        ("queries", "qry"),
        ("reads", "reads"),
        ("rejections", "reject"),
        ("requests", "reqs"),
        ("rows", "rows"),
        ("rpcs", "rpcs"),
        ("seeks", "seeks"),
        ("syncs", "syncs"),
        ("threads", "threads"),
        ("transactions", "txns"),
        ("writes", "writes"),
    ]);
    match suffix.get(unit) {
        Some(x) => {
            x.to_string()
        },
        None => {
            info!("The suffix for {} does not exist, please add to suffix_lookup_value!", unit);
            "?".to_string()
        },
    }
}

