#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn lookup_value_statistic_details_simple_value() {
        let value_statistic_details_lookup = value_create_hashmap();
        let lookup = value_statistic_details_lookup.get("all_operations_inflight").unwrap();
        assert_eq!(lookup.unit_suffix, "ops");
    }
    #[test]
    fn lookup_nonexistent_value_statistic_details_simple_value() {
        let value_statistic_details_lookup = value_create_hashmap();
        let non_existent = ValueStatisticDetails { unit: String::from("?"), unit_suffix: String::from("?"), stat_type: String::from("?") };
        let lookup = value_statistic_details_lookup.get("doesnotexist").unwrap_or(&non_existent);
        assert_eq!(lookup.unit_suffix, "?");
    }

}
